const data = [
  {
    id: "home",
    icon: "iconsminds-home",
    label: "menu.home",
    to: "/app/home"
  },
  {
    id: "categories",
    icon: "iconsminds-box-with-folders",
    label: "menu.categories",
    to: "/app/categories/all",
  },
  {
    id: "expenses",
    icon: "iconsminds-receipt-4",
    label: "menu.expenses",
    to: "/app/expenses",
    subs: [
      {
        icon: "simple-icon-note",
        label: "menu.record",
        to: "/app/expenses/record"
      }
    ]
  },
  {
    id: "analytics",
    icon: "iconsminds-line-chart-1",
    label: "menu.analytics",
    to: "/app/analytics"
  }
];
export default data;
